import React from "react"
import styles from "./Navbar.module.css"

import topdeals from "./Extras/Topdeals.webp"
import bespokeHeader from "./Extras/bespoke-living.webp"
import mobile from "./Extras/mobile.webp"
import tv from "./Extras/tv.webp"
import refigerators from "./Extras/refigerators.webp"
import ACHeader from "./Extras/ACHeader.webp"
import kitchenHeader from "./Extras/kitchenHeader.webp"
import laptopsHeader from "./Extras/laptopsHeader.png"
import tabsHeader from "./Extras/tabsHeader.webp"
import watchHeader from "./Extras/watchHeader.webp"
import wmHeader from "./Extras/wmHeader.webp"

export class Navbar extends React.Component{
constructor(){
super()

this.state={
  images:{topdeals:{slider:[], 
  showCaselinks:["Back to School", "Featured Deals",
                "Mobile & Computing", "Television",
                "Wearable & Accessories", "Home Appliances"]}}
}
}

changeContent = (content) => {
  
}

HeaderComponent(headerImg, headerName){
  return(
    <React.Fragment>
    <button>
    <img src={headerImg} />
    <p> {headerName} </p>
    </button>
    </React.Fragment>
    )
}

render(){
return(

<div className={styles.Navbar}>

<ul>
<li> {this.HeaderComponent(topdeals, "Top Deals")} </li>
<li>  {this.HeaderComponent(bespokeHeader, "Bespoke")}</li>
<li> {this.HeaderComponent(mobile, "Mobile")}</li>
<li> {this.HeaderComponent(tv, "Television")}</li>
<li>  {this.HeaderComponent(refigerators, "Refigerators")}</li>
<li>  {this.HeaderComponent(wmHeader, "Washing Machines")}</li>
<li>  {this.HeaderComponent(ACHeader, "Air Conditioners")}</li>
<li>  {this.HeaderComponent(tabsHeader, "Tablets")}</li>
<li>  {this.HeaderComponent(laptopsHeader, "Laptops")}</li>
<li>  {this.HeaderComponent(kitchenHeader, "Kitchen Care")}</li>
<li>  {this.HeaderComponent(watchHeader, "Accessories")}</li>
</ul>



</div>
)
}

}
